import React from 'react';
import { useState, useEffect } from "react";
import Axios from "axios";

import 'bootstrap/dist/css/bootstrap.min.css';
import MainHeader from './Components/MainHeader';
import outside from './outside.mp4';
import Add from './Components/SignUp';
import './App.css';



import Explorers from './Explorers.PNG';
import ExplorerHome from './ExplorerHome.png';
import tree from './tree.png';

console.log(Explorers);
console.log(ExplorerHome);
console.log(tree);
console.log(outside);

function App()
{
  const [member, setMembers] = useState([]);
  const getMembers = () => {
    Axios.post("http://localhost:3000/members").then((res) => {
      setMembers(res.data);
    });
  };


  useEffect(() => {
    getMembers();
}, [member]);


  return (
    <div className="App">
          <header className="App-header">

          <video width="100%" height="100%" autoPlay loop defaultMuted playsInline muted>
            <source src={outside} type="video/mp4"/>
          </video>

          <MainHeader />
        </header>
        <Add member={member} setMembers={setMembers} />
        <div className="members">
        {member.map((item) => {
          return (
            <div className="member">
              <h3>Username: {item.username}</h3>
              <h3>Password: {item.password}</h3>
              <h3>First Name: {item.mbrfirstname}</h3>
              <h3>Last Name: {item.mbrlastname}</h3>
              <h3>Email: {item.email}</h3>
              <h3>Address: {item.address}</h3>
              <h3>Zip: {item.zip}</h3>
              <h3>State: {item.state}</h3>
            </div>
          );
        })}
        </div>
        </div>
  );
}



export default App;
